import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const DATA = [
  { id: "todo-0", title: "Eat", content: "Health food.", isComplete: true },
  { id: "todo-1", title: "Sleep", content: "For 7-8 hours", isComplete: false },
  { id: "todo-2", title: "Repeat", content: "This is a cycle", isComplete: false }
];

ReactDOM.render(
    <App />, 
  document.getElementById('root')     
);
